import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 1040px;
  height: 50px;
  display: flex; /* Flexbox 사용 */
  justify-content: space-between; /* 왼쪽과 오른쪽 배치 */
  align-items: center; /* 세로 중앙 정렬 */
`;

const TitleText = styled.div`
  height: 35px;
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 30px;
  font-style: normal;
  font-weight: 600;
  line-height: normal;
`;

const DateText = styled.div`
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 22px;
  font-style: normal;
  font-weight: 400;
  line-height: normal;
`;

const Content = styled.div`
  width: 800px;
  height: 50px;
  flex-shrink: 0;
  border-radius: 15px;
  border: 2px solid #4a4e4d;
  background: #fdfbf8;
  display: flex; /* 내부 텍스트 정렬용 */
  align-items: center; /* 세로 중앙 정렬 */
  padding: 0 15px; /* 내부 여백 추가 */
`;

const Text = styled.div`
  color: #000;
  font-family: Roboto;
  font-size: 24px;
  font-style: normal;
  font-weight: 500;
  line-height: normal;
`;

export default function TimelineComponent({ date, content }) {
  return (
    <Container>
      <DateText>{date}</DateText>
      <Content>
        <Text>{content}</Text>
      </Content>
    </Container>
  );
}
